import React, { useEffect, useState } from 'react';
import './App.css';
import NavBar from './components/NavBar';
import Typing from './components/Typing';
import ProgressBar from './components/ProgressBar';
import manojImage from './assets/manoj.jpg';

function App() {
    const [scrollProgress, setScrollProgress] = useState(0);

    const handleScroll = () => {
        const totalScroll = document.documentElement.scrollTop;
        const windowHeight = document.documentElement.scrollHeight - document.documentElement.clientHeight;
        const scroll = (totalScroll / windowHeight) * 100;

        setScrollProgress(scroll);
    };

    const handleResize = () => {
        const navbarHeight = document.querySelector('.navbar').offsetHeight;
        const sections = document.querySelectorAll('.section');
        sections.forEach(section => {
            section.style.minHeight = `calc(100vh - ${navbarHeight}px)`;
        });
    };

    const scrollToSection = (id) => {
        const section = document.getElementById(id);
        const navbarHeight = document.querySelector('.navbar').offsetHeight;
        window.scrollTo({
            top: section.offsetTop - navbarHeight,
            behavior: 'smooth'
        });
    };

    useEffect(() => {
        window.addEventListener("scroll", handleScroll);
        window.addEventListener("resize", handleResize);
        handleResize();
        return () => {
            window.removeEventListener("scroll", handleScroll);
            window.removeEventListener("resize", handleResize);
        };
    }, []);

    return (
        <div className="App">
            <ProgressBar progress={scrollProgress} />
            <NavBar scrollToSection={scrollToSection} />
            <section id="home" className="section home-section">
                <div className="home-content">
                    <div className="left">
                        <img src={manojImage} alt="Manoj" className="manoj-image" />
                    </div>
                    <div className="right">
                        <header className="App-header">
                            <h1>HI I AM MANOJ</h1>
                            <Typing 
                                text={[
                                    "Software Developer.",
                                    "AI/ML Enthusiast.",
                                    "Full Stack Developer.",
                                ]}
                                typingSpeed={100}
                                deletingSpeed={50}
                                duration={1000}
                            />
                        </header>
                    </div>
                </div>
            </section>
            <section id="about" className="section about-section">
                <div className="about-container">
                    <h1>About Me</h1>
                    <div className="about-content">
                        <p>Hi, I'm <strong>Manoj Krishna</strong>, a tech and web development enthusiast who loves to build things. With a passion for creating innovative solutions and exploring new technologies, I'm constantly learning and growing in the field of software development.</p>
                        <p>I'm currently a Computer Science student at <strong>Scaler School of Technology</strong>, where I'm honing my skills and gaining deeper insights into the world of tech.</p>
                        <p>Feel free to connect with me on <a href="https://www.linkedin.com">LinkedIn</a> or check out my projects on <a href="https://github.com">GitHub</a>. Let's build something amazing together!</p>
                    </div>
                </div>
            </section>
            <section id="projects" className="section projects-section">
                <h1>Projects</h1>
                <p>Project section content.</p>
            </section>
            <section id="resume" className="section resume-section">
                <h1>Resume</h1>
                <p>Resume section content.</p>
            </section>
            <section id="skills" className="section skills-section">
                <h1>Skills</h1>
                <p>Skills section content.</p>
            </section>
        </div>
    );
}

export default App;
